 Bubble sort is a sorting algorithm that repeatedly steps through a list and compares adjacent elements, swapping the order if they are in the wrong order.
```python
def bubble_sort(arr):
    for i in range(0, len(arr)):
        for j in range(0, len(arr) - i - 1):
            if arr[j] > arr[j + 1]:
                arr[j], arr[j + 1] = arr[j + 1], arr[j]
    return arr
```
In this code snippet, the bubble sort algorithm is implemented with nested loops. At each iteration, the outer loop iterates through the list from the first element to the last, while the inner loop iterates through the list from the first element to the current element being compared. If the current element is greater than the next element, then the two elements are swapped using the assignment operator.
At the end of the inner loop, the elements are sorted, and the for loop will move to the next element until the entire list is sorted.
